import React from 'react';
import logo from './logo.svg';
import Topbar from './Components/Topbar';
import './App.css';

import imgMB from './Images/MichaelBurry.jpg';
import imgWB from './Images/Warren_Buffett.jpg';
import imgKG from './Images/Ken_Griffin.jpg';

function App() {
  return (
    <div >
      <Topbar />
      <div className = "TopDiv">
        <div>
          <img src = {imgMB} height="300" width = "300" />
          <p>Michael Burry</p>
        </div>
        <div>
          <img src = {imgWB} height = "300" width = "300" />
          <p>Warren Buffett</p>
        </div>
        <div>
          <img src = {imgKG} height = "300" width = "300" />
        </div>
      </div>
      </div>
  );
}

export default App;
